import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const TrackingStatus = () => {
  const [trackingNumber] = useState('20400048699000'); // Пример номера посылки
  const [status, setStatus] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStatus = async () => {
      setLoading(true);
      setError(null);

      try {
        const response = await axios.post('https://api.novaposhta.ua/v2.0/json/', {
          apiKey: 'a3e0146033929135960600cd27f26325',
          modelName: 'TrackingDocument',
          calledMethod: 'getStatusDocuments',
          methodProperties: {
            Documents: [
              {
                DocumentNumber: trackingNumber,
                Phone: ''
              }
            ]
          }
        });

        setStatus(response.data.data[0]);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchStatus();
  }, [trackingNumber]);

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Номер ЕН</TableCell>
            <TableCell>Дата отправки</TableCell>
            <TableCell>Статус отправки</TableCell>
            <TableCell>Сумма</TableCell>
            <TableCell>Номер телефона</TableCell>
            <TableCell>Имя</TableCell>
            <TableCell>Себестоимость</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow>
            {loading && <TableCell colSpan={7}>Загрузка...</TableCell>}
            {error && <TableCell colSpan={7}>Ошибка: {error}</TableCell>}
            {status && (
              <>
                <TableCell>{status.Number}</TableCell>
                <TableCell>{status.RecipientDateTime}</TableCell>
                <TableCell>{status.Status}</TableCell>
                <TableCell>{status.DocumentCost}</TableCell>
                <TableCell>{status.PhoneRecipient}</TableCell>
                <TableCell>{status.RecipientFullName}</TableCell>
                <TableCell>{status.DocumentWeight}</TableCell>
              </>
            )}
          </TableRow>
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TrackingStatus;
